import React, { useEffect } from 'react';

function Gallery(){
    async function load() {
        const accounts = await window.ethereum.request({ method: 'eth_requestAccounts' });
        console.log(accounts[0])
    }
    return(
        <div class="Gallery">
            <h1>Gallery</h1>
            <input type="Button" onClick={load}>
                Press me
            </input>
        </div>
    );
}
export default Gallery;
